private boolean equalsAt(BytesRef a, BytesRef b, int bOffset) {
  return a.length == b.length - bOffset && 
      ArrayUtil.equals(a.bytes, a.offset, b.bytes, b.offset + bOffset, b.length - bOffset);
}

